import React, { Component } from "react";
import Logo from '../../assets/images/klickly-logo-final.svg';
import Bell from '../../assets/images/bell.svg';

const Header = () => {
  return(
        <header className={'header'}>
          <h1>Site description</h1>
          <nav className={'header__navigation'}>
            <ul>
              <li><a href="/" className={'pink-logo'}><img src={Logo} alt="Klicky"/> Brands</a></li>
              <li><a href="#">Home</a></li>
              <li><a href="#">Products</a></li>
              <li><a href="#">Campaigns</a></li>
              <li><a href="#">Orders</a></li>
              <li><a href="#">Performance</a></li>
            </ul>
          </nav>
          <div className={'user-info'}>
            <div className={'user-info__notify'}>
              <img className={'user-info__bell'} src={Bell} alt=""/>
            </div>
            <div className={'user-info__name'}></div>
            <div className={'user-info__icon'}></div>
          </div>
        </header>
  );
}


export default Header;
